<body>
  <div id="bodyContent">
    <div id="statusHeader">
      <div id="movementButtons" style="z-index:1;">
        <img id="prevUserMarkButton" class="navigationButton" src="./reactlogAsset/images/prev-mark.svg" alt="Previous User Mark" title="Previous User Mark (home)" height="24" width="30">
        <img id="prevIdleButton" class="navigationButton" src="./reactlogAsset/images/prev-idle.svg" alt="Previous idle" title="Previous idle (&#8997; &#8679; &#8592;)" height="24" width="30">
        <img id="prevOutputCalcButton" class="navigationButton" src="./reactlogAsset/images/prev-output-calc.svg" alt="Previous output calculation" title="Previous output calculation (&#8997; &#8592;)" height="24" width="30">
        <img id="prevStepButton"  class="navigationButton" src="./reactlogAsset/images/prev-step.svg"  alt="Previous step"  title="Previous step (&#8592;)"  height="24" width="30">
        <img id="nextStepButton"  class="navigationButton" src="./reactlogAsset/images/next-step.svg"  alt="Next step"      title="Next step (&#8594;)"      height="24" width="30">
        <img id="nextOutputCalcButton" class="navigationButton" src="./reactlogAsset/images/next-output-calc.svg" alt="Next output calculation"     title="Next output calculation (&#8997; &#8594;)"     height="24" width="30">
        <img id="nextIdleButton" class="navigationButton" src="./reactlogAsset/images/next-idle.svg" alt="Next idle"     title="Next idle (&#8997; &#8679; &#8594;)"     height="24" width="30">
        <img id="nextUserMarkButton" class="navigationButton" src="./reactlogAsset/images/next-mark.svg" alt="Next User Mark"     title="Next User Mark (end)"     height="24" width="30">
      </div>
      <div id="eventStep">Step: <span id="eventStepNum" class="monospaced-pre"></span></div>
      <div id="eventStatus"></div>
      <div id="eventWrapper">
        <div id="eventTimeBlock">
          <div id="eventTime">Time: </div>
          <div id="eventTimeNum" class="monospaced-pre"></div>
        </div>
        <div id="eventSessionBlock">
          <div id="eventSession">Session: </div>
          <div id="eventSessionNum" class="monospaced-pre"></div>
        </div>
      </div>
      <div id="filter">
        <input id="search" type="text" size="12" placeholder="Search Labels..."/>
      </div>
    </div> <!-- end statusHeader -->

    <div id="timeline" style="z-index:1;">
      <div id="timeline-bg">
        <div id="timeline-fill"></div>
      </div>
    </div>

    <div id="content">
      <div id="cytoWrapper">
        <div id="cyto"></div>
      </div>
      <div id="legend">
        <div class="legendRow legendRowTopMiddle"><div id="legendReady" class="legendColor"></div><div class="legendLabel">Ready</div></div>
        <div class="legendRow legendRowTopMiddle"><div id="legendCalculating" class="legendColor"></div><div class="legendLabel">Calculating</div></div>
        <div class="legendRow legendRowTopMiddle"><div id="legendInvalidating" class="legendColor"></div><div class="legendLabel">Invalidating</div></div>
        <div class="legendRow" id="legendRowInvalidated"><div id="legendInvalidated" class="legendColor"></div><div class="legendLabel">Invalidated</div></div>
        <div class="legendRow" id="legendRowFrozen" style="display:none"><div id="legendFrozen" class="legendColor"></div><div class="legendLabel">Frozen</div></div>
      </div>
      <div id="logEntry" style="display: none;"></div>
    </div>
  </div>
</body>
</html>
